INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1001, 1, 1, 1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, "お！\nあそこに困ってそうな人発見！", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "春咲 ひより", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1002, 1, 1, 1, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, "大切な人を\n守れるようになりたい…って", "みんなみたいに\nわたしも強くならなきゃ", "草野 優衣", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1003, 1, 1, 1, "少しは磨かれると思いますよ。", 0, "キミに必要な集中力と感性が", "フェンシングを始めてみては？", "士条 怜", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.5, 0, 0, 1004, 1, 1, 1, "みそぎはねぇ、\nかくれんぼやりたい！", 0, "今日はなにして遊ぶ？", "ねぇ、にいちゃん！", "穂高 みそぎ", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1006, 1, 1, 1, "私といっしょに…\nいかない？", 0, "ねぇ…", "風宮あかりです", "風宮 あかり", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.5, 0, 0, 1007, 1, 1, 1, "食べ物の恨みは怖いのー", 0, "プリンたべたいのー", "出雲宮子なのー", "出雲 宮子", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1008, 1, 1, 1, "いいよ。\n見られることは運命さ…", 0, "キミもボクの美貌に\n吸い寄せられたんだね。", "ボクは虹村雪。", "虹村 雪", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1009, 1, 1, 1, "人呼んで「疾風の冥姫」!!", 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "フッ…聞いて後悔するがいい！", "柊杏奈", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.5, 0, 0, 1010, 1, 1, 1, "ほんまおおきにやわ～♪", 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "マホマホ王国のプリンセス、\nまほ姫どす", "姫宮 真歩", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1011, 1, 1, 1, "ここで会ったが\n100年目～！", 0, "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲璃乃です！", "衣之咲 璃乃", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1012, 1, 1, 1, "…って、お願い！\n誰にも言わないでおいて～！", 0, "ち、超能力って…\n何のことかな～？", "私はハツネ、\n結構強いんだよ。\nきらーん☆", "柏崎 初音", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1016, 1, 1, 1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, "一応カリスマ読モJKやってまっす！", "ちょす！\n美波鈴奈だよ～♪", "美波 鈴奈", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1017, 1, 1, 1, "でも、沖縄もとってもいいとこさー", 0, "東京は遊園地みたいなところさー", "はいたーい。\n喜屋武香織さー。", "喜屋武 香織", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1018, 1, 1, 1, "イオちゃんって呼んでね。", 0, "先生って呼ばれるのは\nくすぐったいから", "支倉伊緒です。", "支倉 伊緒", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.5, 0, 0, 1020, 1, 1, 1, "ミミをおいてかないでぇ～", 0, "あ！/\お兄ちゃ～ん\nまってよ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "茜 ミミ", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.5, 0, 0, 1021, 1, 1, 1, "ふぇぇぇぇぇん……", 0, "あの……\nふぇ……", "あ…あの…えっと…\n栗…林…くるみ…です……", "栗林 くるみ", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1022, 1, 1, 1, "なんてありがとうございます！", 0, "こんな私に貴重な時間を\n割いていただき、", "風宮よりです。\nあああああ！", "風宮 より", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.5, 0, 0, 1023, 1, 1, 1, "私こっち行きたいー\nね、早く早くー", 0, "おにいちゃんどこいくの？\nえ？", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "北条 綾音", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1025, 1, 1, 1, "これて何か違う…\nあああすみません！", 0, "ふ、不束者ですが\nどうぞ末永く…って、", "わっ…わっ…私、\n天野すずめといいます！", "天野 すずめ", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1027, 1, 1, 1, "離しませんわ………\n絶対に…!!", 0, "あなたは…運命の……\n伴侶……", "……クスクス…私は\n…倉石恵理子……", "倉石 恵理子", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1028, 1, 1, 1, "…そうでしょ？？", 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "佐々木 咲恋", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1029, 1, 1, 1, "あはは、\n私もまだまだだなぁ～", 0, "ぇっと…\nキミ、私のこと知らないの?!", "桜井望だよ！\nよろしくねっ", "桜井 望", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1030, 1, 1, 1, "ショーグン、\nワタシと一緒に天下統一デース！", 0, "初めまして、\n私はニノン・ジュベール申すデス！", "デケデケデンっ！", "ニノン・ジュベール", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1031, 1, 1, 1, "おかしいですね……", 0, "でもって私の隣にいるのが……\nえ、見えない？", "上喜しのぶです。\n手元のドクロが父です。", "上喜 しのぶ", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.5, 0, 0, 1033, 1, 1, 1, "そう、\nオラのボケに突っ込める相方が…！", 0, "けんども\nそれには足りないモンが…", "目指すはビッグな\nお笑い芸人だっぺ！", "野戸まひる", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1034, 1, 1, 1, "ちょ\nちょっと一杯飲んできます…！", 0, "ちょっと緊張しちゃって…", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "綾瀬 ゆかり", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.5, 0, 0, 1036, 1, 1, 1, "これ以上お話しすることは…\nないです！", 0, "知らない人とは話しちゃいけないので", "氷川鏡華…です", "氷川 鏡華", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1038, 1, 1, 1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, "……あ、アラーム。", "柏崎…栞です。", "柏崎 栞", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1040, 1, 1, 1, "野に咲く花が、\n唯一の話相手です。", 0, "私、一人も友達がいなくて……", "ふ、双葉碧です。", "双葉 碧", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1042, 1, 1, 1, "そう思っています。", 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角千歌です。", "三角 千歌", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1043, 1, 1, 1, "う、疑ってすまなかったな…", 0, "あぁ？\nお前のそいつの仲間か？", "安芸真琴だ。", "安芸 真琴", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1044, 1, 1, 1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, "生けとし生ける全ての者よ！", "わらわこそは夜を総べる者！", "イリヤ・オーンスタイン", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1045, 1, 1, 1, "ｌク、クウカに何かご用ですか!?", 0, "ぐふふふふ……はっ！", "そこで騎士は妖精を乱暴に……", "遠見 空花", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1046, 1, 1, 1, "う～ん…\n猫ってホントに最高にゃ～♪", 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまきにゃ♪\n猫はいいにゃよ？", "宮坂たまき", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1048, 1, 1, 1, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, "それでは早速クエストに…", "大神美冬よ！", "大神 美冬", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1049, 1, 1, 1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, "クエストもバトルも\n掃除も洗濯も", "星野静流だよ！", "星野静流", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.5, 0, 0, 1050, 1, 1, 1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, "見ての通りの\nセクシー美少女で", "アタシは玉泉美咲。", "玉泉美咲", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.4, 0, 0, 1052, 1, 1, 1, "？？？？", 0, "？？？？", "？？？", "リマ", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.5, 0, 0, 1053, 1, 1, 1, "そ、そこまでいうなら\nもらってやる", 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", "モニカ・ヴァイスヴィント", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.5, 0, 0, 1058, 1, 1, 1, "そ、そこまでいうなら\nもらってやる", 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", "ペコリーヌ", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.5, 0, 0, 1059, 1, 1, 1, "そ、そこまでいうなら\nもらってやる", 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", "コッコロ", 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (2, 0, 1.5, 0, 0, 1060, 1, 1, 1, "そ、そこまでいうなら\nもらってやる", 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", "キャル", 0);
